import React from 'react';
import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';

const MyCarousel = () => {
  return (
    <AwesomeSlider>
      <div>
        <h3>Duet</h3>
      </div>
      <div>
        <h3>Tequila Mockingbird</h3>
        <h4>This website is a cocktail search and exploration tool that allows users to browse and search for drinks using an API call with React. The website includes a home page, drink display page, and drink details page, and allows users to search by name or browse by alcohol type, ingredient type, and drink type. It is designed to help people discover new drinks and expand their palate. Technologies used in this project include React, Javascript, and CSS, and the website makes use of an API from (https://www.thecocktaildb.com/api.php). Users can navigate the website using a top navigation bar and can see details and instructions for making specific drinks by clicking on drink or ingredient cards.</h4>
      </div>
      <div>
        <h3>Weather or Not</h3>
      </div>
    </AwesomeSlider>
  );
}

export default MyCarousel;
